import React from "react";
import { Route } from "react-router";

const LayoutAdmin = (props) => {
  return (
    <>
      LayoutAdmin
      {props.children}
    </>
  );
};

const AdminTemplate = ({ Component, ...props }) => {
  return (
    <Route
      {...props}
      render={(propsComponent) => {
        <LayoutAdmin>
          <Component {...propsComponent} />
        </LayoutAdmin>;
      }}
    />
  );
};

export default AdminTemplate;
